import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Destinations from './pages/Destinations';
import Gallery from './pages/Gallery';
import ContactUs from './pages/ContactUs';

const slides = [
  "https://cdn.discordapp.com/attachments/1086315786446061711/1127276186536517702/eggy-febryano-T5lflxzlfNI-unsplash.jpg",
  "https://cdn.discordapp.com/attachments/1086315786446061711/1127316166109560984/20220522100430-1-wisata-pulau-seribu-003-andre-kurniawan.jpg",
  "https://cdn.discordapp.com/attachments/1086315786446061711/1127316216227299399/20220522100432-2-wisata-kepulauan-seribu-007-andre-kurniawan.jpg",
  "https://cdn.discordapp.com/attachments/1086315786446061711/1127316239388254268/20220522100431-2-wisata-kepulauan-seribu-006-andre-kurniawan.jpg",
  "https://cdn.discordapp.com/attachments/1086315786446061711/1127316273894805655/20220522100431-1-wisata-pulau-seribu-002-andre-kurniawan.jpg",
];

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/destinations" element={<Destinations />} />
        <Route path="/gallery" element={<Gallery />} />
        <Route path="/contact-us" element={<ContactUs />} />
      </Routes>
    </Router>
  );
}

export default App;
